import logo from './logo.svg';
import './App.css';
import SideNav from './SideNav.js';

function App() {
  return (
    <div className="App">
      <SideNav name='Tester'/>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          "You have to do something xd"
        </p>
        <a
          className="App-link"
          href="https://youtube.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React idiot
        </a>
      </header>
    </div>
  );
}

export default App;
